import React from 'react';
import './portfolio.css'; // Import the CSS file

const Portfolio = () => {
  const projects = [
    {
      name: 'Image Classification with SVMs',
      description: 'Assisted in developing the frontend using React.',
      link: 'https://example.com/project-a'
    },
    {
      name: 'Forest Fire Classification with SVMs',
      description: 'Contributed to backend development with Node.js.',
      link: 'https://example.com/project-b'
    },
    {
      name: 'Project C',
      description: 'Worked on database optimization and queries.',
      link: 'https://example.com/project-c'
    },
    // Add more projects as needed
  ];

  return (
    <div className="portfolio">
      <h2 className="portfolio-heading">My Portfolio</h2>
      <ul className="project-list">
        {projects.map((project, index) => (
          <li key={index} className="project-item">
            <h3 className="project-name">{project.name}</h3>
            <p className="project-description">{project.description}</p>
            <a href={project.link} className="project-link" target="_blank" rel="noopener noreferrer">
              View Project
            </a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Portfolio;
